        self.check1_4.setText(_translate("MainWindow", "Atadura"))
        self.check1_7.setToolTip(_translate("MainWindow", "El procedimiento táctico por el que las piezas propias perturbadoras abandonan su sitio se llama desalojo (o despeje) de casillas o líneas. Se trata de levantar el bloqueo al que uno mismo se ha sometido."))
        self.check1_7.setText(_translate("MainWindow", "Desalojo"))
