        self.check1_2.setText(_translate("MainWindow", "En Descubierta"))
        self.check1_10.setToolTip(_translate("MainWindow", "Eliminación directa de la pieza que controla líneas o casillas importantes en el tablero. Tiene semejanza con la desviación, pero en este caso la pieza contraria es capturada y no desviada."))
        self.check1_10.setText(_translate("MainWindow", "Eliminación Pieza Defensora"))
        self.check1_11.setToolTip(_translate("MainWindow", "Quitar movimiento a una pieza dle rival o diezmarle su movilidad d emanera crítica"))
        self.check1_11.setText(_translate("MainWindow", "Constreñimiento"))
        self.check1_12.setToolTip(_translate("MainWindow", "Mediante este recurso táctico, la conexión entre dos o más piezas del oponente es obstruida, impidiendo el acceso a una casilla o línea vital."))
        self.check1_12.setText(_translate("MainWindow", "Apertura de Líneas"))
        self.check1_13.setToolTip(_translate("MainWindow", "Es un jaque realizado por dos piezas simultáneamente."))
        self.check1_13.setText(_translate("MainWindow", "Jaque  Doble"))
