        self.check1_14.setText(_translate("MainWindow", "Jugada Intermedia"))
        self.check1_15.setToolTip(_translate("MainWindow", "Una táctica que incluye la coronación de un peón. Esto a menudo implica otras tácticas adicionales, cada una de las cuales es parte de un objetivo general: el de coronar el peón.<br> Ese peón a menudo dará resultados decisivos."))
        self.check1_15.setText(_translate("MainWindow", "Coronación de Peón"))
