        self.check1_16.setText(_translate("MainWindow", "Sobrecarga"))
        self.check1_17.setToolTip(_translate("MainWindow", "Una situación en la que un jugador puede dar jaque al rey rival para siempre, pero no puede darle mate. El jaque perpetuo es un tipo de posición de tablas. Cuando se da el jaque perpetuo, los jugadores suelen acordar tablas o, si no, se repite la misma posición tres veces, concluyendo en tablas por la regla de la \"triple repetición\"."))
        self.check1_17.setText(_translate("MainWindow", "Jaque Perpetuo"))
